import React from "react";
import { Routes, Route } from "react-router-dom";
import HomeComp from "./components/home";
import NavComp from "./components/nav";

function App() {
  return (
    <div>
      <NavComp />
      <Routes>
        <Route path="/" element={<HomeComp />} />
      </Routes>
    </div>
  );
}

export default App;
